import React from "react";
import { NavLink } from "react-router-dom";
import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/spaceship.gif";
const CommonParent = () => {
  return (
    <section id="header" className="d-flex align-items-center">
      <div className="container-fluid nav_bg">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row">
              <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                <h1>{props.name} </h1>
                <h1>
                  <strong className="brand-name"> Maah Asghar :)</strong>
                </h1>

                <h2 className="my-3">
                  I am a Software Dveloper, based in London, Ontario, Canada
                </h2>

                <div className="mt-3">
                  <NavLink to="/projects" className="btn-get-started">
                    {props.btname}
                  </NavLink>
                </div>
              </div>

              <div className="col-lg-6 order-1 order-lg-2 header-img">
                <img
                  src={web}
                  className="image-fluid animated"
                  alt="CommonParent img"
                />
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default CommonParent;
